footer{ 
    /* grid-area: 9/ 1 / 12 / 12;  */
    /* background: linear-gradient(90deg, #B0A9A0 20%,#A69E97 60%, #979390 90%); */
    padding : 20px;
    background:  black ;
    text-align: center;
    /* animation: transitionIn 1s; */

    grid-area: footer;
}

 footer img{
  width: 30px;
  height: 30px;
  border-radius: 5px;





}

@media (max-width: 800px) {
    header{
        margin-bottom: 50px;
    }
  #icons {
    display: block;
  }
  #icons:before {
    content: "\2630";
  }
  .active #icons:before {
    content: "\2715";
  }
  nav ul {
    position: fixed;
    left: -100%;
    top: 5%;
    flex-direction: column;
    width: 100%;
    text-align: center;
    transition: 0.25s;
  }
  nav li {
    padding: 3px 0;

  }
   a:hover {
    color: lightblue;
  }
  nav.active ul {
    left: 0;
  }
